// inject the SVG code into the HTML document
const outPutSVG = (selector, svg) => {
    let target = document.querySelector(selector)
    if (target) {
        document.querySelector(selector).innerHTML = svg
    }
}
outPutSVG('.header-logo', logo)
outPutSVG('#home1', home1)
outPutSVG('#plus', plus)

// create a function show and hide elemets 
document.querySelectorAll('[target-attr]').forEach(element => {
    element.addEventListener('click', (e) => {
    let selector = document.querySelector(`#${e.target.getAttribute('target-attr')}`)
    console.log(selector)
    if (selector) {
        if (selector.style.display === 'none') {
            selector.style.display = 'block'
        } else {
            selector.style.display = 'none'
        }
    }})
})